import React from "react";
import ReactDOM from "react-dom";
import { Box } from "@material-ui/core";

const TopLeft = () => {
  return (
    <Box>
      <img
        className="logo-cyberjobs"
        height="100px"
        src="/images/logo-cyberjobs.png"
      />
    </Box>
  );
};

export default TopLeft;
